// Helper to get prayer times for a specific date
export const getPrayerTimes = (date) => {
    const month = String(date.getMonth() + 1).padStart(2, '0');
    const day = String(date.getDate()).padStart(2, '0');
    const key = `${month}-${day}`;

    // Helper to find closest previous date if exact date missing (for simplified dataset)
    if (!prayerTimes2026[key]) {
        // Fallback logic could go here, but for now we return null
        return null;
    }

    return prayerTimes2026[key];
};
